import * as ActionTypes from './ActionTypes';

export const Feedback = ( state = {
    feedback:[]
} , action ) => {
    switch (action.type) {

        case ActionTypes.ADD_FEEDBACK:
            var newfeedback = action.payload;
            return {...state, feedback: state.feedback.concat(newfeedback)};
            
        default:
            return state;
    }
}
